window.bookSummaryJSON = "<p>She’s off-limits. He has none.&nbsp;</p> <p>There’s a girl. Beautiful. Popular. Fake. And my obsession. My fall. Probably my damnation.</p> <p>Did that stop me? Do I care? No and no. There’s a line between right and wrong. Moral and immoral. And then there’s her. I cross every limit with blood-coated fingers. She says she hates me. I say I hate her too as I trap her, own her. Make her all mine.&nbsp;</p> <p><i>Ruthless Empire</i> is part of Royal Elite series but can be listened to on its own. For a better understanding of the world, you might want to listen to the previous titles first. This is a mature new-adult audiobook and contains situations that some listeners might find offensive.</p>"; 
